post_text:
THIS IS OUR ANNOUNCEMENT:

Current CCHS freshmen, sophomores and juniors--check your school email to get the ballot to vote for 2020-21 CCHS Student Body Officers. These are the leadership positions requiring one year of experience on student council at the high school; the ballot to vote has been emailed to you. If you have difficulties with voting, contact Ms. Dickinson or Mrs. Eblen via school email. Voting ends 5:00 PM on Friday, May 15; results will be announced on the student government Twitter account and via school email.

Stay tuned for more info regarding electing class officers (5 positions per grade). Sign up will take place Tuesday, May 19 - 22. Any students currently in grades 9-11 may run for these offices. Current 8th graders will have elections for class officer positions in the fall. Watch for more details to come!

CCHS English I

@ksib
@crestonNews

