Seniors:

Mike Arneson with Josten's will be here on Tuesday, March 31 from 10-11 am at the high school to hand out graduation announcements to those that ordered them. This will be a Drive Up and Go system, so please stay in your vehicle. At this time, cap and gowns will be handed out once we return to school. Any questions, please email Mike Arneson at michael.arneson@jostens.com or Virginia Harlan at vharlan@crestonschools.org

@ksib

